function App() {
  return (
    <BrowserRouter> 
      <div>
        <Routes>
        <Route path="/" exact element={<Home />} />
        <Route path="/NasaPhoto" element={<NasaPhoto />} />
        <Route path="/WildFire" element={<WildFire />} />
        <Route path="/Perseverance" element={<Perseverance />} />
        <Route path="/Earth" element={<Earth />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
